import './App.css';



function addStudent() {
    return (
      <div className="addStudent">
    <header className="App-header">    
      <img src={Menu} className="Menu" alt="logo" />  
      <img src={Info} className="Info" alt="logo" />
  
      <img src={Einstellung} className="Einstellung" alt="logo" />
      </header>



      </div>
      );
    }
    
    export default addStudent;
